import { makeStyles } from '@mui/styles';

export default makeStyles({
  cartSection: {
    width: '226px',
    height: '317px',
  },
  imageHolder: {
    position: 'relative',
    height: '218px'
  },
  price: {
    fontFamily: 'Copperplate',
    color: 'white'
  },
  button: {
    fontWeight: 'bold!important',
    fontSize: '12px!important',
    lineHeight: '9px',
    letterSpacing: '2px'
  }
})
